%[text] %[text:anchor:H_96C63FB6] ## Normal distributions
%[text] When analyzing data, it is critical to visualize the distribution of the data. Visualizing the data gives you important information on how to proceed with the data analysis.  
%[text] Let's start with some random data. The function **randn** creates a random set of numbers that are normally distributed.
data_norm = randn(1000,1)*100+300; % vector of random, normally distributed numbers 
%[text] Our data is a column vector with 1000 rows and 1 column. For fun, we multiply the values by 100 and then add 300 to get the values in the 100s range and mostly greater than 0.
%[text] So, what does normally distributed mean? Let's find out
%%
%[text] ### Start with a Histogram
%[text] We use the function **histogram** to visualize the distribution of the data. 
figure
histogram(data_norm)
xlabel('value'); ylabel('frequency')
%[text] - As you can see the frequency plot is bell-shaped. This is a normally distributed data set
%[text] - Aka Gaussian Distribution
%[text] - For this data, the bell-shape is not perfect because the numbers were randomly generated resulting in random variations \
%%
%[text] %[text:anchor:H_DEDD8A2C] ### Measurements of Central Tendency
%[text] The following are common measurements used to summarize data
%[text] - **Mean** - the average or most common value
%[text] - **Median** - the middle value
%[text] - **Mode** - the single most frequent value
%[text] - **Standard Deviation** - a measure of how dispersed the data is in relation to the mean \
%[text] The following function calculates all of these measurements of central tendencies
function S = calcCentralTendencies(DATA, DESC)

arguments
    DATA {mustBeVector,mustBeNumeric} 
    DESC {mustBeText}
end

% Calculate Measures of Central Tendency and add to Z
S.data = DATA; % set data 
S.desc = DESC; % description of the data distribution
S.mean = mean(S.data); % Calculate the mean
S.median = median(S.data); % Calculate the median
S.mode = mode(S.data); % calculate the mode
S.std = std(S.data); % Calculate the std deviation
end
%[text] For this Function:
%[text] - What are the Input(s)?
%[text] - What are the Output(s)?
%[text] - Can you use this function outside of this Script? 
%[text] - What happens if you run this code block? \
%%
%[text] Call this function as follows
nD = calcCentralTendencies(data_norm,'Normal')
%[text] - Now you have a structure, `nD`, that packages the data and its measurements of central tendency
%[text] - Notice that there is no `S` variable in the workspace? What happened to it?
%[text] - For Normal distributions, the Mean, the Median, and the Mode should all be equal.
%[text] - Here, they are  very, very close. They are not exactly equal because of the random variations in the dataset \
%[text] 
%%
%[text] %[text:anchor:H_7D71B5FA] ### Visualizing Measurements of Central tendency
%[text] We can add our central tendency measurements to the histogram using the function **xline**, which plots a vertical line at the indicated x-coordinate  
figure
histogram(nD.data,FaceAlpha=0.15) % Histogram with the transparency of the bars set to 0.15
xline(nD.mean,'c',LineWidth=2) % add to the plot a vertical line where the mean falls
title(sprintf('%s Distribution',nD.desc)) % add a title to the plot
xlabel('value'); ylabel('frequency') % label the x- and y- axes
%[text] - How would you change the color of the vertical line to Magenta?
%[text] - How would you add the label "mean" to the line
%[text] - Change it back to Cyan with no label before continuing \
%%
%[text] %[text:anchor:H_93C6FE46] #### Now you try: 
%[text] - Add an **`xline`** for the **median**. Make it magenta and dashed (`'m--'` )
%[text] - Add an **`xline`** for the **mode**. Make it blue and dotted ( `'b:'` )  \
%[text] 

%[text] 
%%
%[text] To add a legend, you use the function **`legend`****.**
legend("Data","Mean","Median","Mode",fontsize=12)
%[text] - you should have trouble differentiating between the three lines since the values are so close \
%[text] ### 
%%
%[text] %[text:anchor:H_2B32EDF1] #### Standard deviation
%[text] Adding Standard Deviation to the plot  
figure
histogram(nD.data,FaceAlpha=0.15) % Histogram with the transparency of the bars set to 0.15
xline(nD.mean,'b',LineWidth=2) % mean
xline(nD.mean+nD.std,'m','+1SD') % +1SD
xline(nD.mean-nD.std,'m','-1SD') % -1SD
%[text] - The mean can be found in the  middle of a normal distribution
%[text] - The standard deviation is plotted relative to the mean (+1 SD or -1SD from the mean) \
%%
%[text] ### The Normal Curve
%[text] %[text:anchor:TMP_1f55] **aka a Probability Distribution Function**
%[text] So, what's so great about a normal distribution? Well, if you fit a curve to the data, you can use that curve to calculate the probability of a value in a given dataset. This is called the Normal Curve.
%[text]  Remember, in a normal distribution the most probable values are closest to the mean, while the least probable values are furthest from the mean.
pd = fitdist(nD.data,'Normal'); % Fit a normal curve to the data
figure
plot(pd)
%[text] This normal curve is also known as a Probability Distribution Function, or PDF. The total area under this curve represents a probability of 1. You can break this probability down into parts using the standard deviation and the mean: 
%[text] ![](text:image:93d5)
%[text] - 68% (dark blue) of all data fall within one standard deviation (ùúé) of the mean (¬µ) .
%[text] - 95.45% (blue) of the data falls within 2 standard deviations.
%[text] - 99.73% (light blue) fall within 3 standard deviations \
%[text] 
%%
%[text] %[text:anchor:H_2AD001CB] #### The Standard Deviation and the Shape of the Normal Curve
%[text] All you need to create a normal curve (or PDF)  is the mean and the standard deviation, which determine the position and the shape of the curve. In the following example, we create a normal curve using the **makedist** function, which accepts a mean and a standard deviation as inputs. 
%[text] Move the sliders to change the mean and/or the standard deviation and see how that affects the shape of the curve
clf
slider_mean = 0; % adjust the mean %[control:slider:6ea7]{"position":[15,16]}
slider_std = 12; % adjust the standard deviation %[control:slider:3bb5]{"position":[14,16]}
pd = makedist("Normal","mu",slider_mean,"sigma",slider_std); % creates a normal curve object
plot(pd) % plots the normal curve
xlim([-120 120]) % sets the x limits
ylabel('Probability Density Function')
%[text] Notice:
%[text] - The Mean sets the location of the center of the curve
%[text] - a small SD results in a steep and narrow curve
%[text] - a large SD results in a shallow and broad curve \
%[text] 
%%
%[text] ### Calculating probabilities with the PDF (or normal curve)
%[text] So, how can you calculate probabilities using a PDF?  MATLAB comes with lots of functions to calculate probabilities based on the normal curve. 
%[text] #### Example: Heights
%[text] Let's consider heights. The average height of a woman is 63.7 (5'4") with a standard deviation of 2.5. (source: [https://www.cdc.gov/nchs/fastats/body-measurements.htm)](https://www.cdc.gov/nchs/fastats/body-measurements.htm))
female.mu = 63.7;
female.sigma = 2.5;
% female.heights = female.sigma.*randn(1000,1)+female.mu; % randomly generate 1000 female heights
%%
%[text] With just the mean and standard deviation, we can create a normal curve using the function `makedist`.
figure
female.pd = makedist("Normal","mu",female.mu,"sigma",female.sigma); % creates a normal curve object
plot(female.pd) % plots the normal curve
xline(female.mu,'m','mean',LineWidth=2,LabelOrientation='horizontal')
xline([female.mu-female.sigma female.mu+female.sigma],'k:',{'SD-1' 'SD+1'})
grid minor
%[text] - `pd` contains the normal curve \
%%
%[text] #### Probability of a Range of Heights
%[text] We can use the function **normspec** to determine the probability of the range of heights of women between -1 SD and +1 SD from the mean
p = normspec([female.mu-female.sigma female.mu+female.sigma], female.mu, female.sigma); % get probability
grid minor
fprintf('There is a probability of %1.2f%% that a woman''s height will fall between %1.2f" and %1.2f".', ...
    p*100,female.mu-female.sigma, female.mu+female.sigma)
%[text] - Notice that we are just inputting values based on the mean and standard deviation into the function `normspec`
%[text] - The function then creates a normal curve and calculates the  probabilities based on that curve
%[text] - Ladies, raise your hand if your height falls within this range (Remember, 60" = 5 feet) \
%%
%[text] #### Probability of a Single Height (Percentile)
%[text] So, how tall (or likely) is a 6'10" woman?
%[text] The function `cdf` calculates the cumulative probability of a single value in relation to the normal curve. Here we plug in our Normal Curve object for Female Heights,  female.`pd` 
p = cdf(female.pd,70) % cumulative probability up to 70"
fprintf('A 70" woman is taller than %1.2f%% of all women.',p*100)
%[text] - aka 99th percentile \
%%
%[text] To calculate this probably, `cdf` calculates the area under the normal curve up to the indicated height:
p=normspec([-inf 70], female.mu, female.sigma);
xline(70,'m--',"tall")
%[text] - Average Height of Women in the WNBA is 72" \
%[text] 
%%
%[text] %[text:anchor:H_CD844226] ### Example: Men's Height
%[text] Men, on average are 69 inches  (5' 9") with a standard deviation of 3"
male.mu = 69; % mean height
male.sigma = 3; % std height
male.pd = makedist("Normal",  "mu",male.mu,"sigma",male.sigma); % create a PDF for male heights

figure
colororder(["m" "b"]) % set color order

plot(female.pd) % plot female PDF for comparison
hold on
plot(male.pd) % plot male PDF
grid minor
xline(male.mu,'k--','Mean',LineWidth=1)

xline([male.mu-female.sigma male.mu+female.sigma],'k:',{'SD -1' 'SD +1'})
legend("Female","Male")
%[text] - Notice that there is an overlap in height
%[text] - Meaning that a certain percentage of women are equal to or taller in stature than men
%[text] - The Tallest Men are Taller than the Tallest Women
%[text] - The Shortest Women are shorter than the Shortest men \
%%
%[text] %[text:anchor:H_00B04914] #### Where are my Short Kings at?
%[text] Shorter than one standard deviation of the mean is
h = male.mu-male.sigma
%[text] 5 foot 6'
%[text]  The area under the curve for 66 inches for the male PDF is 
p = cdf(male.pd,h)
%%
%[text] ‚Ä¶and for the female PDF:
p = cdf(female.pd,h)
%[text] So, 5'6" is 16th percentile for males and 82nd percentile for females. 
%%
%[text] Women's preferred height in men?
ll = [] % lower limit e.g. 69 (the mean)
ul = [] % upper limit e.g. 75
p = normspec([ll ul], male.mu,male.sigma)
%%
%[text] ## Comparing Distributions
%[text] The distribution of the data has important implications on how the data should be analyzed and how you should report your summary  statistics. For example,  as we have just seen, the best summary statistics for Normally distributed data are the Mean and the Standard Deviation‚Äîthey determine the normal curve. Other distributions, like skewed datasets, are best described by the median and the interquartile range. 
%[text] So it is important to visualize your data and be able to visually determine the distribution of your data in order to best analyze that data. 
%%
%[text] ### Creating Random values with Different Distributions
%[text] We will compare the normally distributed data to data with a uniform distribution or with a distribution that is skewed.
%[text] Here's some skewed data ([source](https://www.mathworks.com/help/stats/exploratory-analysis-of-data.html)). 
lD = calcCentralTendencies([normrnd(4,1,1,350),normrnd(6,0.5,1,650)]'*100, 'Skewed Left') % numeric array - skewed data
rD = calcCentralTendencies([normrnd(2,1,1,650),normrnd(6,3,1,350)]'*100, 'Skewed Right') % numeric array - skewed data
%%
%[text] And here's Uniformly Distributed Data ([`rand`](https://www.mathworks.com/help/matlab/ref/double.rand.html))
uD= calcCentralTendencies(rand(1000,1)*800, 'Uniform')
%[text] - What does the function `normrnd` do?
%[text] - What does the function `rand` do?
%[text] - notice the data for each distribution is 1000 X 1 vector in each case
%[text] - Notice how for both distrubtions the Mean, Median, and Mode are NOT very close at all \
%%
%[text] ### Histograms of our data sets
figure;

nexttile % new tile for normal data
histogram(nD.data) %histogram
title(nD.desc) % add title 
ylabel('Frequency',FontWeight='bold') % label y-axis
xlabel('Value',FontWeight='bold') % label x-axis


nexttile % left skewed data
histogram(lD.data)
title(lD.desc)

nexttile % uniform data
histogram(uD.data)
title(uD.desc)

nexttile % right skewed data
histogram(rD.data)
title(rD.desc)
%[text] - Can you see any differences in the data distributions?
%[text] - Why is the Skewed Data "skewed left" or "skewed right"?
%[text] - What do you think Uniform means? How likely is any given value in the dataset? What Casino Related device might generate a uniform data distribution? \
%%
%[text] ### Fit Normal Curves to the Histograms
%[text] The MATLAB function `histfit plots a histogram and overlays the normal curve`
figure;

nexttile % add new tile for normal data
histfit(nD.data) % normal histogram normal curve overlay
title(nD.desc) % add title

nexttile  % left skewed
histfit(lD.data)
title(lD.desc)

nexttile %uniform
histfit(uD.data) 
title(uD.desc)

nexttile % right skewed
histfit(rD.data) 
title(rD.desc)
%[text] - Which data set is best represented by the Normal Curve?
%[text] - Which data sets are poorly represented by the Normal Curve \
%%
%[text] The function  **myHistOverlay** plots the histogram and overlays the Summary Statistics
function myHistOverlay(S)

% Plot the data
histogram(S.data,FaceAlpha=0.15); % histogram with semi-transparent bars
title(sprintf('%s Distribution', S.desc)) % add the title
xlabel('value'); ylabel('frequency') % label the x and y axes

% add xlines
xline(S.mean,'b','Mean')
xline(S.median,'m--','Median')
xline(S.mode,'g:','Mode')
xline(S.mean+S.std,'r', 'SD+1')
xline(S.mean-S.std,'r', 'SD-1')
end
%[text] - What is the Input?
%[text] - What is the Output? \
%%
%[text] #### Histogram with summary stats
%[text] Here we add the Mean, Median, and ¬±1 SD to each histogram plot
figure;

nexttile % normal data
myHistOverlay(nD)

nexttile % left skewed data
myHistOverlay(lD)

nexttile % uniform data
myHistOverlay(uD)

nexttile % right skewed data
myHistOverlay(rD)
%[text] - Compare the Mean, Median, and Mode
%[text] -  In the skewed data, which is closer to the peak (most frequent value)? The Mean or Median? \
%%
%[text] ### Other Types of Distribution Plots
%[text] Bar plots are not distribution plots. They are just visualizations of the summary statistics (typically the mean and standard deviation). 
%[text] Here we plot the mean and standard deviation of our datasets
figure;
bar([nD.mean lD.mean rD.mean uD.mean]) % plotting the means as bars
ylabel('Mean')
hold on
errorbar([nD.mean lD.mean rD.mean uD.mean],[nD.std lD.std rD.std uD.std],'k',LineStyle='none') % adding error bars
xticklabels({nD.desc lD.desc rD.desc uD.desc}) % labeling the ticks
%[text] - Bar plots give very little information about the distribution of the data and may be misleading
%[text] - For example, there is no evidence of the skewed nature of the data by just looking at the mean and standard deviation
%[text] - Bar plots should only be used for normal data, since normal data are best represented by the mean  and standard deviation.  \
%%
%[text] #### Box plot of Normal Data
%[text] A box plot visualizes the summary statistics. Here we compare visualizations of the same data as a box plot and a histogram. We have turned the histogram on its side for comparison
figure;
tiledlayout("horizontal")

ax(1) = nexttile;
hb = boxchart(nD.data); % return handle to boxchart
hb.Parent.XAxis.Visible='off'; % turn off x-axis
grid on % turn on grid
title("Box Plot") % add title
ylabel('Value') % label y-axis
yline(nD.mean-nD.std,'m:','-1 SD')
yline(nD.mean+nD.std,'m:','+1 SD')

ax(2) = nexttile;
histogram(nD.data,Orientation="horizontal") % plot histogram
yline(nD.median,'m--',"median",LineWidth=2,FontSize=9) % add median line
grid on % turn on grid
title("Histogram") % add title
xlabel('Frequency') % lable the X axis

linkaxes(ax,'y') % match the axes properties for easier comparison
%[text] Box plots are a better visualization of the distribution than bar charts because they plot more statistical information:
%[text] - The line in the middle is the median
%[text] - The box represents the interquartile range: 25th to 75th percentile
%[text] - The whiskers represent the range of the data \
%[text] One key for spotting normality in a data set is to look for symmetry:
%[text] - Notice in the box chart of the Normal Data, the median is in the middle of the interquartile box
%[text] - Also notice that the whiskers extend to equal lengths on either side of the box
%[text] - The interquartile range is not the same thing as the standard deviation
%[text] -     interquartile range contains 50% of the data
%[text] -     ¬± 1SD contains 67% of the data \
%[text] ![](text:image:5a3d)
%%
%[text] #### Box Plot Comparisons
%[text] Here are all of our dataset visualized as Box Plots. Note, the following syntax works because each dataset is column vector of the same size (1000x1)
figure
boxchart([nD.data lD.data rD.data uD.data]) % create box plots, one column for each plot
xticklabels({nD.desc lD.desc rD.desc uD.desc}) % change x-axis tick labels
ylabel('Value')
%[text] - Notice the location of the median inside the interquartile box are not centered in the skewed data
%[text] - Notice the distribution of outliers
%[text] - Notice that Uniform looks pretty symmetric but its not normal data \
%[text] So, while box plots are compact, you still lose some information about the true distribution of the data
%%
%[text] ### Swarm, swarm, swarm
%[text] Swarm charts plot ALL the data,  You get one dot for each data point. This makes it easy to spot distribution trends. 
%[text] Here is the normal data as a swarm chart with a box chart overlay (using the course function `mmBoxSwarm`)
figure
tiledlayout("horizontal")

ax(1) = nexttile; % swarm chart
mmBoxSwarm([],nD.data); % overlay box and swarm charts
title("Swarm")
grid on 

ax(2) = nexttile; % histogram chart
histogram(nD.data,Orientation="horizontal") % plot histogram
yline(nD.median,'m--',"mean",LineWidth=2,FontSize=9) % add median line
grid on % turn on grid
title("Histogram") % add title
xlabel('Frequency') % label the X axis
linkaxes(ax,'y') % match the y-axes properties for comparison
%[text] - Notice how the data is distributed symmetrically around the mean - this is an indicator of normality
%[text] - The plot is fattest at the mean. Kind of like a bell curve on its side. Kind of like a mirror image of the histogram
%[text] - Notice that we don't have an x-axis ‚Äî Swarm charts are 1D plots with random variations along the x-axis (jitter) to illustration distribution trends \
%%
%[text] #### Swarm Chart Comparison
%[text] Here we plot all the datasets has a swarm charts, one axis for each plot
figure;
tiledlayout("horizontal")

nexttile % add tile to figure
mmBoxSwarm([],nD.data) % normal
ylabel('Value','FontWeight','bold') % add y-axis label
title(nD.desc)

nexttile
mmBoxSwarm([],lD.data) % left skewed data
title(lD.desc)

nexttile
mmBoxSwarm([],rD.data) % right skewed 
title(rD.desc)

nexttile
mmBoxSwarm([],uD.data) % uniform
title(uD.desc)
%[text] - Swarm Charts are more compact than Histograms
%[text] - Notice how much easier it is to determine the distribution of the data using a swarm chart, especially when you have a lot of data points
%[text] - The shape of the swarm chart is determined by  math similar to that used to create Normal Curves (kernel density estimates)
%[text] - You can clear see the long tails in the skewed data
%[text] - The distribution of the uniform data is uniformly distributed along the length of the plot \
%%
%[text] ### Violin Plots
%[text] Violin plots plot just the shapes of the swarm charts without all of the data points
figure
tiledlayout("horizontal")

ax(1) = nexttile; % violin chart
mmBoxSwarm([],nD.data,"doBoxPlot",false,"PlotType",'violin')
title("Violin")
grid on 

ax(2) = nexttile; % histogram chart
histogram(nD.data,Orientation="horizontal") % plot histogram
yline(nD.median,'m--',"mean",LineWidth=2,FontSize=9) % add median line
grid on % turn on grid
title("Histogram") % add title
xlabel('Frequency') % label the X axis


linkaxes(ax,'y') % match the y-axes properties for comparison
%[text] - Violin plots are cleaner than swarm charts, but can sometimes be harder to interpret \
%%
%[text] #### Violin Plot comparisons
%[text] Here we plot all the data as violin plots
figure;
tiledlayout("horizontal")
violinplot([nD.data lD.data rD.data uD.data])
xticklabels({nD.desc lD.desc rD.desc uD.desc})
ylabel('Value')
grid on
%[text] - notice that the shapes are a bit more stylized then the swarm charts \
%%
%[text] #### Violin plots take some liberties with the distribution
%[text] Here we overlay box plots to show where the medians and outliers fall
hold on
boxchart([nD.data lD.data rD.data uD.data],BoxFaceColor='k')
%[text] - These plots tend to extend past the actual range of the data (pointy bits at each end)
%[text] - The outliers in the skewed data do not extend past the violin plots \
%[text] 
%%
%[text] #### 
%%
%[text] How does the interquartile range compare to ¬± 1 SD?
xline(nD.mean+nD.std,'m','+1SD') % +1SD line
xline(nD.mean-nD.std,'m','-1SD') % -1SD line
%[text] -  \
%%
%[text] %[text:anchor:H_E736EFD0] ### The swarm chart and box plot
%[text] A swarm chart plots every single data point, jittering the x-position to separate all the points. 
%[text] - Swarm charts require both an x and y vector
%[text] - Since we just have one group of data, we can se the x to a vector of ones that are the same size as the data \
figure(Visible="on")
x = ones(1, numel(data_Normal)); % create a vector of ones
y = data_Normal; % set y to the data
swarmchart(x,y, 'filled',MarkerFaceAlpha=0.5)
yline(median(data_Normal),'r--')
%[text] - The distinct shape of the plot gives an indication of the distribution of the data.
%[text] - Here, the symmetrical nature of the plot around the median (red line) indicates a normal distribution \
%%
%[text] Often, swarm charts and box plots are plotted together
hold on
boxchart(x,y)
%%
%[text] %[text:anchor:H_7743439C] ### Box plot Swarm Chart function
%[text] Just like for the histogram, we can create a function to simplify overlaying box and swarm charts together. 
%[text] The function is called **myBoxSwarmChart** and it takes one input, Y. Input the data into Y
function myBoxSwarmChart(Y)

desc = extractAfter(inputname(1),'_'); % get name of inputted variable

X = ones(size(Y));
swarmchart(X,Y, 'filled',MarkerFaceAlpha=0.5)
hold on
boxchart(X,Y)
title(desc)
end
%%
%[text] %[text:anchor:H_B94BD656] #### **Now you try**
%[text] - Create a figure with 3 horizontal tiles.
%[text] - Use **myBoxSwarmChart** to plot the Normal, Nonparametric, and Uniform data \
figure(Visible="on")
tiledlayout("horizontal")


nexttile
myBoxSwarmChart(data_Normal)

nexttile
myBoxSwarmChart(data_Nonparametric)

nexttile
myBoxSwarmChart(data_Uniform)
%[text] - Easier to represent the data in a tighter space
%[text] - However, using just the boxplot does accurately represent the distribution of the data
%[text] - In the nonparametric plot, the median is not in the center of the boxplot \
%%
%[text] %[text:anchor:H_A39B64C3] ## Sample Size
%[text] The larger the sample size, the easier to identify the distribution. And vice versa.
%[text] ### Histogram Comparison
%[text] Here we compare samples of increase size drawn from a normal distribution
figure
sz = [5 10 25 30 50 100];
for n=sz
    nexttile
    sample = randn(n,1)*100+300; % create a random  normal sample of indicated size n
    histfit(sample)
    title(sprintf('Sample Size %d',n))
end
%[text] - Data doesn't look normal until greater than 25
%[text] - typically, 30 is a good sample size to ensure normality \
%%
%[text] #### Box Swarm Charts
figure;

for n=sz
    nexttile
    sample = randn(n,1)*100+300;
    mmBoxSwarm([],sample,"MarkerFaceColor",'k','XJitterWidth',0.5)
    title(sprintf('Sample Size %d',n))
